import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
// import { store } from './app/store';
import { Provider } from 'react-redux';
import * as serviceWorker from './serviceWorker';
import { createStore } from 'redux'


// selector
const MESSAGESENDER_INPUT = 'MESSAGESENDER_INPUT';
const MESSAGERECEIVER_INPUT = 'MESSAGERECEIVER_INPUT';

// Actions
export const messageData = () => ({type : MESSAGESENDER_INPUT})
export const amountofData = () => ({type : MESSAGERECEIVER_INPUT})

//Reducer
const dataReducer = (state,actions) => {
  switch (actions.type){
    case 'MESSAGESENDER_INPUT':
      return state = "data:image/jpeg;base64,"
      case MESSAGERECEIVER_INPUT:
        return state = "data:image/jpeg;base64,"
        default:
          return state = "data:image/jpeg;base64,"
  }
}

let store = createStore (dataReducer);
// store.subscribe(() => {console.log(store.getState())});

store.dispatch(messageData());
store.dispatch(amountofData());






ReactDOM.render(
  <React.StrictMode>
    <Provider  store={store} >
      <App />
      </Provider>
      </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
